package refineimg

import (
	"encoding/base64"
	"fmt"
	"log"
	"testing"
)

const (
	webpBase64 = ""
)

func TestPerform(t *testing.T) {
	input, err := base64.StdEncoding.DecodeString(webpBase64)
	if err != nil {
		log.Fatal(err)
	}
	output := Refine(input)
	outBase64 := base64.StdEncoding.EncodeToString(output)
	fmt.Println(outBase64)
}
